window.bookSummaryJSON = "<p><b>A dark sci-fi thriller in the vein of </b><b><i>Alien </i></b><b>or John Carpenter's </b><b><i>The Thing</i></b><b>....</b></p> <p>She wakes up drowning, escapes from a watery canister into a deathtrap of fiery corridors and exploding machinery.&nbsp;</p> <p>Somehow, she’s in space.&nbsp;</p> <p>She can’t remember her name or why she’s here.&nbsp;</p> <p>Her mind is a mixed-up Rubik’s cube of fuzzy memories.&nbsp;</p> <p>But she knows that spaceships don’t exist, and if they did ordinary girls like her don’t belong on them.&nbsp;</p> <p>And there’s something else. She’s not alone.&nbsp;</p> <p>Someone or something lurks in the shadows.&nbsp;</p> <p>And it wants her dead....</p> <p><i>Nomad </i>is the tale of an ordinary 1980s girl who wakes up in the middle of space opera.&nbsp;</p> <p>Jamie Nash, the writer of horror films like <i>V/H/S/2</i>, <i>Lovely Molly, Exists </i>and <i>Altered</i> brings this science-fiction horror that's part space-opera slasher and part mind-bending mystery and part MTV Generation (<i>Stranger Things</i>/<i>Ready Player One</i>) nostalgia-fest.</p>"; 
